import React from "react";
import "./jumbotorn.css";

const Jumbotron = () => (
	<header className = "header">
		<h1>Marvel Clicky Game!</h1>
		<h2>Click on any image to earn a point, but do not  click on any images more than once!</h2>
	</header>
);
export default Jumbotron;
